script: |
  super -f text -I q3375.spq | sort > q3375.out

inputs:
  - name: q3375.spq
    data: |
      SELECT col2 * col0 + - col2 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT ( col2 * + 44 * - col2 * + col0 ) NOT IN ( ( - - 55 ), + CAST ( - - 75 AS INTEGER ), + + col2 );
  - name: tab2

outputs:
  - name: q3375.out
    data: |
